script: |
  super -f text -I q770.spq | sort > q770.out

inputs:
  - name: q770.spq
    data: |
      SELECT DISTINCT + + 94 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 * + col2 NOT IN ( + CAST ( NULL AS REAL ), col2 * + col0 * + 91 + + col1 );
  - name: tab2

outputs:
  - name: q770.out
    data: |
